import logo from './logo.svg';
import './App.css';
import Header from './Components/Header';
import Cover from './Components/Cover';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faGithub } from '@fortawesome/free-brands-svg-icons' 
import { faLinkedin } from '@fortawesome/free-brands-svg-icons' 
import Contact from './Components/Contact'
import DownloadLink from "react-download-link";
import Portfolio from './Components/Portfolio';

function App() {
  const github = <FontAwesomeIcon icon={faGithub} size="2x"/>
  const linkedin = <FontAwesomeIcon icon={faLinkedin} size="2x"/>

  return (



    <div>
        <Header/>
        <Cover/>

       <Portfolio/>
       <Contact/>
       <h2>
         Resume
       </h2>
       <p>
         Download my <DownloadLink  label="Resume" filename="myfile.txt" exportFile={() => "My cached data"}/> here.
       </p>

        <footer>
        <ul>
            <li>
              <span role="img" aria-label="github">{github}</span>
            </li>
            <li>
              <span role="img" aria-label="linkedin">{linkedin}</span>
            </li>
         </ul>
        </footer>
    </div>

  );
}

export default App;
